import React from 'react';
import './DailyScorePopup.scss';

const DailyScorePopup = ({ metrics, closePopup }) => {
  return (
    <div className="daily-score-popup">
      <div className="popup-content">
        <h3>Daily Driving Metrics</h3>
        <p>Distance Covered: {metrics.total_distance_covered_km} km</p>
        <p>Driving Score: {metrics.driving_score}</p>
        <p>Category: {metrics.driving_category}</p>
        <button onClick={closePopup}>Close</button>
      </div>
    </div>
  );
};

export default DailyScorePopup;
